import styled from "styled-components";

export const HomeMain = styled.main`
  margin: 0;
  padding: 0;
  box-sizing: border-box;

  .content-wrapper {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }
`;
